const imgBase64 = `
data:image/png;base64,
`

$(document).ready(function () {

  $('#startVideoButton').click(function() {
    $('.video-hide-wrapper').css('display', 'block')
    $('#startVideoButton').css('display', 'none')
    $('.broom-icon').css('display', 'none')
  })

  dragElement(document.querySelector('.broom-icon'));

  function dragElement(elmnt) {
    var pos1 = 0,
      pos2 = 0,
      pos3 = 0,
      pos4 = 0;
    if (document.getElementById(elmnt.id + 'header')) {
      // if present, the header is where you move the DIV from:
      document.getElementById(elmnt.id + 'header').onmousedown = dragMouseDown;
    } else {
      // otherwise, move the DIV from anywhere inside the DIV:
      elmnt.onmousedown = dragMouseDown;
    }

    function dragMouseDown(e) {
      e = e || window.event;
      e.preventDefault();
      // get the mouse cursor position at startup:
      pos3 = e.clientX;
      pos4 = e.clientY;
      document.onmouseup = closeDragElement;
      // call a function whenever the cursor moves:
      document.onmousemove = elementDrag;
    }

    function elementDrag(e) {
      e = e || window.event;
      e.preventDefault();
      // calculate the new cursor position:
      pos1 = pos3 - e.clientX;
      pos2 = pos4 - e.clientY;
      pos3 = e.clientX;
      pos4 = e.clientY;
      // set the element's new position:
      elmnt.style.top = elmnt.offsetTop - pos2 + 'px';
      elmnt.style.left = elmnt.offsetLeft - pos1 + 'px';
    }

    function closeDragElement() {
      // stop moving when mouse button is released:
      document.onmouseup = null;
      document.onmousemove = null;
    }
  }

  var bridge = document.getElementById('bridge'),
    bridgeCanvas = bridge.getContext('2d'),
    brushRadius = 30,
    img = new Image();
    bridgeCanvas.canvas.width = bridge.width * 2;
    bridgeCanvas.canvas.height = bridge.height * 2;
  img.onload = function () {
    bridgeCanvas.drawImage(img, 0, 0, bridge.width, bridge.height);
  };
//   img.loc = './images/';
//   img.filename = 'spiderweb.png';
//   img.class = 'image-class';
  img.src = imgBase64

  function getBrushPos(xRef, yRef) {
    var bridgeRect = bridge.getBoundingClientRect();
    return {
      x: Math.floor(
        ((xRef - bridgeRect.left) / (bridgeRect.right - bridgeRect.left)) *
          bridge.width
      ),
      y: Math.floor(
        ((yRef - bridgeRect.top) / (bridgeRect.bottom - bridgeRect.top)) *
          bridge.height
      ),
    };
  }

  function getFilledInPixels(stride) {
    if (!stride || stride < 1) { stride = 1; }
    
    var pixels   = bridgeCanvas.getImageData(0, 0, bridge.width, bridge.height),
        pdata    = pixels.data,
        l        = pdata.length,
        total    = (l / stride),
        count    = 0;
    
    // Iterate over all pixels
    for(var i = count = 0; i < l; i += stride) {
      if (parseInt(pdata[i]) === 0) {
        count++;
      }
    }
    
    return Math.round((count / total) * 100);
  }

  function handlePercentage(filledInPixels) {
    filledInPixels = filledInPixels || 0;
    // console.log(filledInPixels + '%');
    if(filledInPixels >= 98.5) {
        $('#startVideoButton').css('display', 'block')
    }
  }

  function drawDot(mouseX, mouseY) {
    bridgeCanvas.beginPath();
    bridgeCanvas.arc(mouseX, mouseY, brushRadius, 0, 2 * Math.PI, true);
    bridgeCanvas.fillStyle = '#000';
    bridgeCanvas.globalCompositeOperation = 'destination-out';
    bridgeCanvas.fill();
    handlePercentage(getFilledInPixels(32));
  }

  bridge.addEventListener(
    'mousemove',
    function (e) {
      var brushPos = getBrushPos(e.clientX, e.clientY);
      var leftBut = 1
      if (leftBut == 1) {
        drawDot(brushPos.x, brushPos.y);
      }
    },
    false
  );

  bridge.addEventListener(
    'touchmove',
    function (e) {
      e.preventDefault();
      var touch = e.targetTouches[0];
      if (touch) {
        var brushPos = getBrushPos(touch.pageX, touch.pageY);
        drawDot(brushPos.x, brushPos.y);
      }
    },
    false
  );
});
